import React, { useState } from 'react';
import jsPDF from 'jspdf';
import { saveAs } from 'file-saver';
import { Document, Packer, Paragraph, TextRun } from 'docx';

const App = () => {
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [phone, setPhone] = useState('');
  const [website, setWebsite] = useState('');
  const [linkedin, setLinkedin] = useState('');
  const [github, setGithub] = useState('');

  const handlePDFDownload = () => {
    const doc = new jsPDF();
    doc.text(`Name: ${name}`, 10, 10);
    doc.text(`Email: ${email}`, 10, 20);
    doc.text(`Phone: ${phone}`, 10, 30);
    doc.text(`Website: ${website}`, 10, 40);
    doc.text(`LinkedIn: ${linkedin}`, 10, 50);
    doc.text(`GitHub: ${github}`, 10, 60);
    doc.save('resume.pdf');
  };

  const handleDOCDownload = async () => {
    const doc = new Document({
      sections: [
        {
          children: [
            new Paragraph({
              children: [new TextRun(`Name: ${name}`)],
            }),
            new Paragraph({
              children: [new TextRun(`Email: ${email}`)],
            }),
            new Paragraph({
              children: [new TextRun(`Phone: ${phone}`)],
            }),
            new Paragraph({
              children: [new TextRun(`Website: ${website}`)],
            }),
            new Paragraph({
              children: [new TextRun(`LinkedIn: ${linkedin}`)],
            }),
            new Paragraph({
              children: [new TextRun(`GitHub: ${github}`)],
            }),
          ],
        },
      ],
    });

    const blob = await Packer.toBlob(doc);
    saveAs(blob, 'resume.docx');
  };

  return (
    <div className="app-container">
      <div className="form-container">
        <h1>Resume Builder</h1>
        <form>
          <div>
            <label>Name: </label>
            <input
              type="text"
              value={name}
              onChange={(e) => setName(e.target.value)}
            />
          </div>
          <div>
            <label>Email: </label>
            <input
              type="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
            />
          </div>
          <div>
            <label>Phone: </label>
            <input
              type="tel"
              value={phone}
              onChange={(e) => setPhone(e.target.value)}
            />
          </div>
          <div>
            <label>Portfolio Website: </label>
            <input
              type="url"
              value={website}
              onChange={(e) => setWebsite(e.target.value)}
            />
          </div>
          <div>
            <label>LinkedIn: </label>
            <input
              type="url"
              value={linkedin}
              onChange={(e) => setLinkedin(e.target.value)}
            />
          </div>
          <div>
            <label>GitHub: </label>
            <input
              type="url"
              value={github}
              onChange={(e) => setGithub(e.target.value)}
            />
          </div>
        </form>
        <div className="buttons-container">
          <button onClick={handlePDFDownload}>Download as PDF</button>
          <button onClick={handleDOCDownload}>Download as DOC</button>
        </div>
      </div>
      <div className="letter-box-container">
        <div className="letter-box">
          <h1>A4 Resume Page</h1>
          <h2>{name}</h2>
          <p>{email} <b> ┊ </b> {phone} <b> ┊ </b> {website} <b> ┊ </b> {linkedin} <b> | </b> {github}</p>
        </div>
      </div>
    </div>
  );
};

export default App;
